import {products} from "./Utills/Custom"

function ProductsListing() {
    return ( 
        <div className="container mx-auto">
            <div>

            </div>
            <div className="grid grid-cols-4 gap-6">
                {products.map((items)=>{
                    return(
                        <div className="p-4 border rounded-lg bg-[#e5e7eb] shadow-xl">
                            <img src={items.image} alt=""className="cart "/>
                            <h4>{items.name}</h4>
                            <p></p>
                            <p>Price: {products.price}/100</p>
                            <button className="hidden cart-hover:block">Add to Cart</button>
                        </div>
                    )
                })}
            </div>
        </div>
     );
}

export default ProductsListing;
